import React from 'react';
import './Carousel.css';

import pic1 from '../assets/frontend_assets/animonda.png';
import pic2 from '../assets/frontend_assets/bioline.png';
import pic3 from '../assets/frontend_assets/classic_pets.png';
import pic4 from '../assets/frontend_assets/petkin.png';
import pic5 from '../assets/frontend_assets/meO.png';
import pic6 from '../assets/frontend_assets/arm&hammer.png';
import pic7 from '../assets/frontend_assets/equilibrio.png';
import pic8 from '../assets/frontend_assets/spot.png';
const Carousel = () => {
    return (
        <div className='carousel'>
            <div className="logos">
                <img src={pic1} alt="" />
                <img src={pic2} alt="" />
                <img src={pic3} alt="" />
                <img src={pic4} alt="" />
                <img src={pic5} alt="" />
                <img src={pic6} alt="" />
                <img src={pic7} alt="" />
                <img src={pic8} alt="" />
            </div>
            <div className="logos">
            <img src={pic1} alt="" />
                <img src={pic2} alt="" />
                <img src={pic3} alt="" />
                <img src={pic4} alt="" />
                <img src={pic5} alt="" />
                <img src={pic6} alt="" />
                <img src={pic7} alt="" />
                <img src={pic8} alt="" />
            </div>
        </div>
    );
};

export default Carousel;
